import React from "react";
import './Contacts.css';
import Header from '../Header/Header';
const Contacts=()=>{
    return(
        <div className="section-container">
            
            <Header
                heading='Get in touch.'
                details='Interested to collaborate? Feel free to drop me an email.'
            />
            </div>
    );
};
export default Contacts;
